import React from 'react'
import Task from './Task'
function Tasks({tasks, onDelete, onToggle}) {
    return (
        <div>
            {tasks.map((task) =>(
                <Task key={tasks.id} task= {task} onDelete={onDelete} onToggle={onToggle}/>
            ))}
        </div>
    )
}

export default Tasks
